import React from 'react';

function History({ history }) {
  return (
    <div className="history">
      <h2>Pairing History</h2>
      <div className="pair-list">
        <h3>Previously Paired Students</h3>
        <ul>
          {history.map((p, index) => (
            <li key={index}>{`${p[0]} & ${p[1]}`}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default History;
